import axios from "axios";

const CATEGORIES_BASE_GET_URL = "http://localhost:8080/api/v1/categories";

class Save {
  saveCategories(category) {
    return axios.post(CATEGORIES_BASE_GET_URL,category);
  }
}
export default new Save();
